import React, { Component} from "react";

class About extends Component {

    constructor(props) {
        super(props)
    }

    render(){
        return(
            <div id="aboutDiv">
                <p id="about">
                    {this.props.about}
                </p>
                <hr className="sectionDivider"></hr>
            </div>
        )
    }

}

export default About
